<p><span aria-owns="rmiz-modal-bad95f61a444" data-rmiz=""><span data-rmiz-content="found" style={{visibility: "visible"}}><img src="https://mintlify.s3-us-west-1.amazonaws.com/danswer/images/quickstart/DanswerWebConnector.png" alt="DanswerWebConnector" /></span><span data-rmiz-ghost="" style={{height: "458px", left: "0px", width: "532px", top: "0px"}}><button aria-label="Expand image: DanswerWebConnector" data-rmiz-btn-zoom="" type="button"><svg aria-hidden="true" data-rmiz-btn-zoom-icon="true" fill="currentColor" focusable="false" viewBox="0 0 16 16" xmlns="http://www.w3.org/2000/svg"><path d="M 9 1 L 9 2 L 12.292969 2 L 2 12.292969 L 2 9 L 1 9 L 1 14 L 6 14 L 6 13 L 2.707031 13 L 13 2.707031 L 13 6 L 14 6 L 14 1 Z"></path></svg></button></span></span></p>
